        const res = await axios.get('http://localhost:3003/user')
        console.log(res)
      }
      getUser();
    })

    return (
      <div>
        {users.map(user => {

          return(
            <div>
              <h3>{user.username}</h3>
              <p>age: {user.age}</p>
              <p>hobby: {user.hobbies}</p>
            </div>
          )
        })}
